inp = real.split()

width = 0
height = 0
for line in inp:
    height += 1
    width = len(line)
print(width, height)


def valid_pos(x,y):
    return x >= 0 and x < width and y >= 0 and y < height
    
def count_near(x,y,radius,symbol):
    count = 0
    for x_off in range(-radius, radius+1):
        for y_off in range(-radius, radius+1):
            if valid_pos(x+x_off,y+y_off) and inp[x+x_off][y+y_off] == symbol:
                count += 1
    return count
    

#  (x-1,y-1)(x  ,y-1)(x+1,y-1)
#  (x-1,y  )(x  ,y  )(x+1,y  )
#  (x-1,y+1)(x  ,y+1)(x+1,y+1)


total = 0
change = 1
while change > 0:
    change = 0
    copy = inp
    for x in range(width):
        for y in range(height):
            if count_near(x,y,1,"@") < 5 and inp[x][y] == '@':
                new_line = list(copy[x])
                new_line[y] = 'x'
                copy[x] = ''.join(new_line)
                change += 1
    total += change
    inp = copy
print(total)

